tables.table_schema:
CREATE TABLE Birds (
	bird_id INT PRIMARY KEY,
	bird_name VARCHAR(50),
	migration_start_date DATE,
	migration_end_date DATE
);

CREATE TABLE PopulationTrends (
	population_id INT PRIMARY KEY,
	population_count INT,
	population_date DATE,
	bird_id INT REFERENCES Birds(bird_id)
);

CREATE TABLE BirdLocations (
  id INT PRIMARY KEY,
  bird_species VARCHAR(50),
  location VARCHAR(100),
  migration_season VARCHAR(50)
);

CREATE TABLE PopulationTrends (
  id INT PRIMARY KEY,
  location VARCHAR(100),
  year INT,
  population_count INT
);

CREATE TABLE MigrationRoutes (
  id INT PRIMARY KEY,
  bird_species VARCHAR(50),
  route_description TEXT,
  migration_distance FLOAT
);
